   // Create a 5x5 grid of bunnies in the container\n    for (let i = 0; i < 25; i++) {\n        const bunny = new Sprite(texture);\n        bunny.x = (i % 5) * 40;\n        bunny.y = Math.floor(i / 5) * 40;\n        container.addChild(bunny);\n    }\n    // Move the container to the center\n    container.x = app.screen.width / 2;\n    container.y = app.screen.height / 2;\n    // Center the bunny sprites in local container coordinates\n    container.pivot.x = container.width / 2;\n    container.pivot.y = container.height / 2;\n    // Listen for animate update\n    app.ticker.add((time) => {\n        // Continuously rotate the container!\n        container.rotation -= 0.01 * time.deltaTime;\n    });\n    console.log(' PIXI-only (no Moxi) example loaded');\n}\n"},"animated-character":{name:"04 - Animated Character",description:"Sprite animation with camera following",init:async function(){const t=document.getElementById("canvas-container");if(!t)throw new Error("App element not found");const{scene:i,engine:s,loadAssets:n,camera:o,PIXIAssets:r}=await vr({hostElement:t});i.renderer.background.color=3818598,await n([{src:Cr,alias:"character_sheet"}]);const a=r.get("character_sheet");a.source.scaleMode="nearest";const l=br(e,a,{frameWidth:48,frameHeight:48,columns:4,rows:4}),h=new e.AnimatedSprite(l);h.anchor.set(.5),h.x=i.renderer.width/2,h.y=i.renderer.height/2,h.scale.set(4),h.textures=[l[0],l[1]],h.animationSpeed=.05,h.play();const c=Q(h);i.addChild(c),i.init(),s.start(),console.log(" Animated Character example loaded")},source:"import { setupMoxi, asEntity, asTextureFrames } from 'moxi';\nimport * as PIXI from 'pixi.js';\nimport { ASSETS } from '../assets-config';\n/**\n * Animated Character Example\n * Demonstrates sprite animation using texture frames and camera following\n */\nexport async function initAnimatedCharacter() {\n    const root = document.getElementById('canvas-container');\n    if (!root)\n        throw new Error('App element not found');\n    // Get the Moxi setup\n    const { scene, engine, loadAssets, camera, PIXIAssets } = await setupMoxi({\n        hostElement: root\n    });\n    scene.renderer.background.color = 0x3a4466; // Dark blue background\n    // Load character spritesheet\n    await loadAssets([\n        { src: ASSETS.SPROUTLANDS_CHARACTER, alias: 'character_sheet' }\n    ]);\n    // Get the character sheet texture\n    const baseTexture = PIXIAssets.get('character_sheet');\n    // Set the scale mode to nearest neighbor for better quality\n    baseTexture.source.scaleMode = 'nearest';\n    // Create texture frames from the character spritesheet\n    const characterFrames = asTextureFrames(PIXI, baseTexture, {\n        frameWidth: 48,\n        frameHeight: 48,\n        columns: 4,\n        rows: 4\n    });\n    // Create character sprite\n    const character = new PIXI.AnimatedSprite(characterFrames);\n    character.anchor.set(0.5);\n    character.x = scene.renderer.width / 2;\n    character.y = scene.renderer.height / 2;\n    character.scale.set(4); // Scale up for visibility\n    // Set up the idle animation (first two frames)\n    character.textures = [characterFrames[0], characterFrames[1]];\n    character.animationSpeed = 0.05;\n    character.play();\n    // Convert to Moxi entity\n    const characterEntity = asEntity(character);\n    // Add character to scene\n    scene.addChild(characterEntity);\n    // Initialize and start\n    scene.init();\n    engine.start();\n    console.log(' Animated Character example loaded');\n}\n"},"progress-bar":{name:"05 - Progress Bar",description:"Custom Logic component creating an animated progress bar",init:async function(){const t=document.getElementById("canvas-container");if(!t)throw new Error("App element not found");const{scene:i,engine:s,loadAssets:n}=await vr({hostElement:t});await n([{src:Tr,alias:"kenney-future-thin"}]);const{width:o,height:r}=i.renderer.canvas,a=r/2-120,l=Q(new e.Container),h=new zr({...Vr,backgroundColor:"silver",color:16737792,barWidth:400,barHeight:55,bitmapText:{...Vr.bitmapText,fontSize:32,align:"center",fill:"black"}},void 0,!1);l.moxiEntity.addLogic(h),l.position.set(o/2-200,a+160),i.addChild(l);const c=Q(new e.Container),u=new zr({...Vr,backgroundColor:"silver",color:54527,barWidth:400,barHeight:55,bitmapText:{...Vr.bitmapText,fontSize:32,align:"center",fill:"black"}},h,!1);c.moxiEntity.addLogic(u),c.position.set(o/2-200,a+80),i.addChild(c);const m=Q(new e.Container),d=new zr({...Vr,backgroundColor:"silver",color:65280,barWidth:400,barHeight:55,bitmapText:{...Vr.bitmapText,fontSize:32,align:"center",fill:"black"}},u,!0);m.moxiEntity.addLogic(d),m.position.set(o/2-200,a),i.addChild(m),i.init(),s.start()},source:"import { Logic, asEntity, setupMoxi } from 'moxi';\nimport * as PIXI from 'pixi.js';\nimport { ASSETS } from '../assets-config';\nexport const defaultProgressBarOptions = {\n    barWidth: 200,\n    barHeight: 20,\n    max: 100,\n    min: 0,\n    color: 0x00ff00,\n    backgroundColor: 0x555555,\n    barPadding: new PIXI.Point(5, 5),\n    bitmapText: {\n        fontFamily: 'kenney-future-thin',\n        fontSize: 32,\n        fontStyle: 'normal',\n        fill: 'black',\n    }\n};\nexport class ProgressBarLogic extends Logic {\n    constructor(options = {}, nextBar, autoIncrement = false) {\n        super();\n        this.options = options;\n        this.autoIncrement = false;\n        this.forgroundBar = new PIXI.Graphics();\n        this.backgroundBar = new PIXI.Graphics();\n        this.value = 0;\n        this.nextBar = nextBar;\n        this.autoIncrement = autoIncrement;\n        this.options = { ...defaultProgressBarOptions, ...options };\n    }\n    setValue(value) {\n        this.value = value;\n    }\n    addBean() {\n        this.value += 1;\n        // Check if this bar is now full\n        if (this.value >= this.options.max) {\n            // Add a bean to the next bar\n            if (this.nextBar) {\n                this.nextBar.addBean();\n            }\n            // Reset this bar\n            this.value = 0;\n        }\n    }\n    init(entity, renderer) {\n        const { width, height } = renderer.canvas;\n        const { backgroundColor, color, barWidth, barHeight, barPadding, bitmapText } = this.options;\n        const padding = new PIXI.Point(barPadding.x, barPadding.y);\n        this.value = 0;\n        this.backgroundBar = new PIXI.Graphics();\n        this.backgroundBar.rect(0, 0, barWidth, barHeight);\n        this.backgroundBar.fill(backgroundColor);\n        this.forgroundBar = new PIXI.Graphics();\n        this.forgroundBar.rect(padding.x, padding.y, 0, barHeight - padding.y);\n        this.forgroundBar.fill(color);\n        this.bitmapText = new PIXI.BitmapText({\n            text: `%${this.value}`,\n            style: bitmapText\n        });\n        this.bitmapText.position.set((barWidth / 2) - (this.bitmapText.width / 2), (barHeight / 2) - (this.bitmapText.height / 2));\n        this.backgroundBar.eventMode = 'none';\n        this.forgroundBar.eventMode = 'none';\n        this.bitmapText.eventMode = 'none';\n        entity.addChild(this.backgroundBar);\n        entity.addChild(this.forgroundBar);\n        entity.addChild(this.bitmapText);\n        // Position will be set externally in initProgressBar\n    }\n    update(entity, deltaTime) {\n        const { max, barWidth, barHeight, color, backgroundColor, barPadding } = this.options;\n        const padding = new PIXI.Point(barPadding.x, barPadding.y);\n        // Only auto-increment if this bar is set to auto-increment\n        if (this.autoIncrement) {\n            this.value += (deltaTime * 10);\n            // Check if we completed\n            if (this.value >= max) {\n                // Add a bean to the next bar\n                if (this.nextBar) {\n                    this.nextBar.addBean();\n                }\n                // Reset\n                this.value = 0;\n            }\n        }\n        const paddedWidth = (barWidth - padding.x * 2);\n        const percent = (this.value / max);\n        const width = Math.min(paddedWidth * percent, paddedWidth);\n        this.backgroundBar.clear();\n        this.backgroundBar.rect(0, 0, barWidth, barHeight);\n        this.backgroundBar.fill(backgroundColor);\n        this.forgroundBar.clear();\n        this.forgroundBar.rect(padding.x, padding.y, width, barHeight - (padding.y * 2));\n        this.forgroundBar.fill(color);\n        const textvalue = Math.floor(percent * 100);\n        if (this.bitmapText) {\n            this.bitmapText.text = `${textvalue}%`;\n        }\n    }\n}\nexport async function initProgressBar() {\n    const root = document.getElementById('canvas-container');\n    if (!root)\n        throw new Error('App element not found');\n    const { scene, engine, loadAssets } = await setupMoxi({ hostElement: root });\n    // Load the font for the percentage text\n    await loadAssets([\n        { src: ASSETS.KENNEY_FUTURE_THIN_FONT, alias: 'kenney-future-thin' }\n    ]);\n    const { width, height } = scene.renderer.canvas;\n    const barWidth = 400;\n    const barHeight = 55;\n    const spacing = 80;\n    const startY = (height / 2) - (spacing * 1.5); // Center all 3 bars vertically\n    // Create bars in reverse order so we can chain them\n    // Bar 3 (orange) - static counter, just displays beans\n    const progressBar3 = asEntity(new PIXI.Container());\n    const bar3Logic = new ProgressBarLogic({\n        ...defaultProgressBarOptions,\n        backgroundColor: 'silver',\n        color: 0xff6600, // Orange\n        barWidth,\n        barHeight,\n        bitmapText: {\n            ...defaultProgressBarOptions.bitmapText,\n            fontSize: 32,\n            align: 'center',\n            fill: 'black'\n        }\n    }, undefined, false); // No next bar, doesn't auto-increment\n    progressBar3.moxiEntity.addLogic(bar3Logic);\n    progressBar3.position.set((width / 2) - (barWidth / 2), startY + (spacing * 2));\n    scene.addChild(progressBar3);\n    // Bar 2 (cyan) - static counter, accumulates beans from bar 1, sends to bar 3\n    const progressBar2 = asEntity(new PIXI.Container());\n    const bar2Logic = new ProgressBarLogic({\n        ...defaultProgressBarOptions,\n        backgroundColor: 'silver',\n        color: 0x00d4ff, // Cyan\n        barWidth,\n        barHeight,\n        bitmapText: {\n            ...defaultProgressBarOptions.bitmapText,\n            fontSize: 32,\n            align: 'center',\n            fill: 'black'\n        }\n    }, bar3Logic, false); // Links to bar 3, doesn't auto-increment\n    progressBar2.moxiEntity.addLogic(bar2Logic);\n    progressBar2.position.set((width / 2) - (barWidth / 2), startY + spacing);\n    scene.addChild(progressBar2);\n    // Bar 1 (green) - ONLY bar that auto-increments\n    const progressBar1 = asEntity(new PIXI.Container());\n    const bar1Logic = new ProgressBarLogic({\n        ...defaultProgressBarOptions,\n        backgroundColor: 'silver',\n        color: 0x00ff00, // Green\n        barWidth,\n        barHeight,\n        bitmapText: {\n            ...defaultProgressBarOptions.bitmapText,\n            fontSize: 32,\n            align: 'center',\n            fill: 'black'\n        }\n    }, bar2Logic, true); // Links to bar 2, auto-increments!\n    progressBar1.moxiEntity.addLogic(bar1Logic);\n    progressBar1.position.set((width / 2) - (barWidth / 2), startY);\n    scene.addChild(progressBar1);\n    scene.init();\n    engine.start();\n}\n"},"bunny-adventure":{name:"06 - Bunny Adventure",description:"Player movement with arrow keys, tile world, and camera",init:async function(){const t=document.getElementById("canvas-container");if(!t)throw new Error("App element not found");const{scene:i,engine:n,loadAssets:o,camera:r,PIXIAssets:a}=await vr({hostElement:t});i.renderer.background.color=8962160,await o([{src:"../assets/sprout-lands-basic/Tilesets/Grass.png",alias:"grass_sheet"},{src:Cr,alias:"character_sheet"}]),r.desiredScale.set(3);const l=a.get